import './App.css';
import { browserHistory, Route } from 'react-router-dom';

class App extends Component {
  state = {
    foo : "bar"
  }

  handleButtonClick = () => {
    // alert(this.state.foo);
    // browserHistory.push('/test');
    // this.props.history.push('/test');
    // alert(window.location.href);
    window.location.href = "/hi"
  }

  // <button onClick={() => hashHistory.push(`/mySite/accountview?id=${account.AccountName}`)}></button>


  render() {
    return (
      <div className="App">
      <form action >
        <TextField
        label="Player1" /> <br />
        <TextField
        label="Player2" /> <br /> <br />
        <Button onClick = {this.handleButtonClick}> Let's Play! </Button>
      </form>
      </div>
    );
  }
}

export default App;
